import { Link } from "react-router-dom"
import { useState } from "react";
import { Navigate } from "react-router-dom";
const Login = () => {
    const [formVal, setFormVal] = useState({
        email: "",
        password: ""
    }
    );

    const handleChange = (event) => {
        const {name, value} = event.target
        setFormVal(prevFromVal => {
           return {
            ...prevFromVal,
            [name]: value
           } 
        })
    }
    const handleSumbit = (event) => {
        event.preventDefault();

    }
    const [signInState, setSignInState] = useState(false);

    if (signInState) {
        return <Navigate to = "/"/>
    }
    return (
        <main>
            <div className="background"></div>
            <h3>Sign Up</h3>
            <form className="Sign-in" onSubmit={handleSumbit}>
                <h3 className="back-btn" onClick={() => {setSignInState(true);}}>Home</h3>
                <label>
                    Email
                    <input 
                        for="username" 
                        type = "text" 
                        placeholder = "Email" 
                        name = "email" 
                        onChange={handleChange} 
                        value = {formVal.email}
                    />
                </label>
                <label>
                    Password
                    <input 
                        for = "password" 
                        type = "text" 
                        placeholder="Password" 
                        name = "password"
                        onChange={handleChange} 
                        value = {formVal.password}
                    />
                </label>
                <button className = "submit" type = "submit" onClick={() => {setSignInState(true);}}>Log in</button>
                <div class="social">
                    <div class="go"><i class="fab fa-google"></i>  Google</div>
                </div>
                <div className="link"><Link to = "/signup">Don't have an account? Click here to Signup</Link></div>
            </form>
        </main>
    )
}

export default Login
